import React from 'react';

const Footer = () => {
  return (
    <footer className="footer bg-dark text-white py-3 mt-auto">
      <div className="container text-center">
        <p>&copy; 2024 Transport Lamarque. Tous droits réservés.</p>
      </div>
    </footer>
  );
};

export default Footer;
